    return(
        <div>
<BrowserRouter>
<Container maxWidth="lg">
          <Header/>
          <Switch>
          <Route Path="/" component={Home}/>
          <Route Path="/auth" component={Login}/>
          </Switch>
          <Footer/>
  </Container>
  </BrowserRouter>
        </div>

    );
}

export default App;
